mapper.select:
	select 
	 
	from t_shopping_detail 
		where 1=1 
		 
        and user_id like CONCAT(CONCAT('%',#{userId,jdbcType=VARCHAR}),'%')  
      
      
        and box_id like CONCAT(CONCAT('%',#{boxId,jdbcType=VARCHAR}),'%') 
      
      
       and layout_id like CONCAT(CONCAT('%',#{layoutId,jdbcType=VARCHAR}),'%')  
      
      
       and print_paper_id like CONCAT(CONCAT('%',#{printPaperId,jdbcType=VARCHAR}),'%')   
      
      
       and paper_grams_id like CONCAT(CONCAT('%',#{paperGramsId,jdbcType=VARCHAR}),'%')  
      
      
       and print_color_id like CONCAT(CONCAT('%',#{printColorId,jdbcType=VARCHAR}),'%')   
      
     
      
       and surface_treatment_id like CONCAT(CONCAT('%',#{surfaceTreatmentId,jdbcType=VARCHAR}),'%')   
      
      
        and is_bronzing = #{isBronzing,jdbcType=INTEGER}
      
      
      
       and is_convex = #{isConvex,jdbcType=INTEGER}
      
     
      
       and is_UV = #{isUv,jdbcType=INTEGER}
      
      
      
       and is_PVC = #{isPvc,jdbcType=INTEGER}
      
      
      
       and receive_area_id like CONCAT(CONCAT('%', #{receiveAreaId,jdbcType=VARCHAR}),'%')  
      
      
      
       and print_number = #{printNumber,jdbcType=INTEGER}
